svg.script:
 function init(){
		setAnimations();
  }

// workaround for firefox bug (browser cannot execute function getElementById if the element animate is unknown)
function myGetElementById(id) 
{
  var element = document.getElementById(id);
  if(element==null && document.evaluate!=null) 
  {
    element = document.evaluate(
    '//*[@xml:id="' + id + '" or @id="' + id + '"]', document, function(ns) 
    {
        switch(ns) {
            case "xml": return "http://www.w3.org/XML/1998/namespace";
            case null: return null;
        }
   }, XPathResult.ANY_TYPE, null).iterateNext();
 }
 return element;
}

function setAnimations() {
 for(var i=1; i<8; i++) {
	var busTrack=document.getElementById('busTrack'+i);
	var busTrackAnim=myGetElementById('dashAnim'+i);
var busAnim=myGetElementById('bus'+i);
	trackLength=busTrack.getTotalLength().toString();
//alert(busTrack.getTotalLength());
	var dur = busTrack.getTotalLength()/80;
	busTrack.setAttributeNS(null,'stroke-dasharray',trackLength+','+trackLength);
	busTrack.setAttributeNS(null,'stroke-dashoffset',trackLength);
	busTrackAnim.setAttributeNS(null,'from',trackLength);
	busTrackAnim.setAttributeNS(null,'to','0');
//	busTrackAnim.setAttributeNS(null,'values',trackLength+';0');
	busTrackAnim.setAttributeNS(null,'dur',dur);
busAnim.setAttributeNS(null,'dur',dur);
	var prev = i-1;
	if(i>1) { busTrackAnim.setAttributeNS(null,'begin','dashAnim'+prev+'.end+2s');}
	busTrackAnim.setAttributeNS(null,'end','resetButton.click');
 }

}

function reset() { 
    for(var i=1; i<8; i++) {
    	var busTrack=document.getElementById('busTrack'+i);
	var busTrackAnim=myGetElementById('dashAnim'+i);
	trackLength=busTrack.getTotalLength().toString();
	busTrack.setAttributeNS(null,'stroke-dasharray',trackLength+','+trackLength);
	busTrack.setAttributeNS(null,'stroke-dashoffset','0');
	busTrackAnim.setAttributeNS(null,'from','0');
	busTrackAnim.setAttributeNS(null,'to',trackLength);
	busTrackAnim.setAttributeNS(null,'dur','0.01s');
//	busTrackAnim.setAttributeNS(null,'values','0;'+trackLength);	
	var prev = i-1;
	if(i>1) { busTrackAnim.setAttributeNS(null,'begin','dashAnim'+prev+'.end');}
   }
//  alert("reset OK");  // OK
   alert(document.getElementById("startButton").click()); // Δε δουλεύει !!!!!!!
   document.getElementById("startButton").click();            // Δε δουλεύει !!!!!!!
}
